;
;	Light Speed Player v1.03
;	Fastest Amiga MOD player ever :)
;	Written By Arnaud Carré (aka Leonard / OXYGENE)
;	https://github.com/arnaud-carre/LSPlayer
;	twitter: @leonard_coder
;
;	"Insane speed" player version ( half scanline average player time! )
;	(this source code is generated by LSPConvert)
;	You can also use the generic LightSpeedPlayer.asm player ( less than 512bytes! )
;
;	MOD in  : 108KiB + 50KiB (knullakuk.mod)
;	LSP out : 108KiB + 82KiB
;
;	--------How to use--------- 
;
;	bsr LSP_MusicDriver+0 : Init LSP player code
;		a0: LSP music data(any memory)
;		a1: LSP sound bank(chip memory)
;		a2: DMACON 8bits byte address
;
;	bsr LSP_MusicDriver+4 : LSP player tick (call once per frame)
;		a6: should be $dff0a0 (and not $dff000)
;		Used regs: d0/a0/a1/a2/a3/a4
;
;*****************************************************************

; copper list:
copperMain:
			dc.l	$01fc 0000			; move 0 to Fetch mode register
			dc.l	$0100 0200			; move $200 to BPLCON0 : Enables color burst output signal
			
			dc.l	(50<<24)|($09fffe)			; wait scanline 50
			dc.l	$009c8000|(1<<4)			; fire copper interrupt

			dc.l	((50+11)<<24)|($09 fffe)		; wait scanline 50+11
			dc.l	$0180000f				; fond = couleur $000f
copperDMAConPatch:
			dc.l	$0096 8000				; $0096 = DMACON clear control bit. automodifié
			dc.l	$0180 0000				; fond = couleur $0000
			dc.l	-2



	opt o-	; switch off ALL optimizations(we don't want vasm to change some code size, and all optimizations are done!)

LSP_MusicDriver:
			bra.w	.LSP_PlayerInit

;LSP_MusicDriver+4		; Player tick to call each frame
			lea		.LSPVars+8(pc),a1
			move.l	(a1),a0					; byte stream
.process:	moveq	#0,d0
			move.b	(a0)+,d0
			beq.s	.extended1
			add.w	d0,d0
			move.w	.LSP_JmpTable(pc,d0.w),d0		; 14 cycles
			jmp		.LSP_JmpTable(pc,d0.w)		; 14 cycles

.extended1:	move.w	#$0100,d0
			move.b	(a0)+,d0
			add.w	d0,d0
			move.w	.LSP_JmpTable(pc,d0.w),d0
			jmp		.LSP_JmpTable(pc,d0.w)

.r_rewind:	move.l	0-8(a1),16-8(a1)
			move.l	24-8(a1),a0
			bra.s	.process


