.LSPVars:		dc.l	0			; 0  word stream loop
			dc.w	0			; 4  reloc has been done
			dc.w	0			; 6  current music BPM
			dc.l	0			; 8  pointeur byte stream		+8
			dc.l	0			; 12 m_lfmDmaConPatch
			dc.l	0			; 16 pointeur word stream
			dc.l	0			; 20 pointeur word stream loop
			dc.l	0			; 24 pointeur byte stream loop

; WARNING: in word stream, instrument offset is shifted by -12 bytes (3 last long of .LSPVars)
.LSP_InstrumentInfo:			; (15 instruments)
; adresse relative début sample
; longeur sample *2 ( valeur en word )
; adresse relative début répétition sample
; longeur répétition * 2 ( valeur en word )
			dc.w	$0000,$af52,$1188,$0000,$d134,$0096
			dc.w	$0001,$7a9a,$191d,$0001,$7a9a,$0001
			dc.w	$0000,$0004,$08a8,$0000,$0004,$0001
			dc.w	$0000,$70fc,$0662,$0000,$70fc,$0001
			dc.w	$0000,$7dc0,$0d39,$0000,$7dc0,$0001
			dc.w	$0000,$1154,$2753,$0000,$5eee,$0086
			dc.w	$0001,$282e,$0bba,$0001,$3f22,$0040
			dc.w	$0000,$fe34,$14fd,$0000,$fe34,$0001
			dc.w	$0000,$df2a,$0f85,$0000,$df2a,$0001
			dc.w	$0000,$d262,$0664,$0000,$d262,$0001
			dc.w	$0000,$9832,$0b90,$0000,$9832,$0001
			dc.w	$0000,$5ffa,$0881,$0000,$5ffa,$0001
			dc.w	$0001,$53ee,$1356,$0001,$53ee,$0001
			dc.w	$0001,$3fa2,$0a26,$0001,$3fa2,$0001
			dc.w	$0001,$acd4,$00fd,$0001,$ad84,$000f

; pointeurs sur la table des instruments, pour repetition de D C B A
.resetv:	dc.l	0,0,0,0

; a0: music data (any mem)
; a1: sound bank data (chip mem)
; a2: 8bit DMACON byte address
.LSP_PlayerInit:
			move.l	#$ee61e523,d0
			cmp.l	(a1),d0
			bne.s	.dataError
			cmpi.l	#'LSP1',(a0)+							; A0+4
			bne.s	.dataError
			cmp.l	(a0)+,d0							; A0+8
			bne.s	.dataError
			lea		1102(a0),a0		; skip header			; A0+8+1102
			lea		.LSPVars(pc),a3
			move.l	a2,12(a3)		; 8bit DMACON byte address
			move.l	a0,16(a3)		; word stream ptr			; +1110 / $456
			movea.l	a0,a4
			add.l	#49084,a4
			move.l	a4,8(a3)		; byte stream ptr			; +1110+49084=$C412/50194

			add.l	#12530,a0	; word stream loop pos
			move.l	a0,(a3)		; word stream loop ptr
			add.l	#6874,a4	; byte stream loop pos
			move.l	a4,24(a3)	; byte stream loop ptr
			tst.b	4(a3)
			bne.s	.noReloc
			st		4(a3)
			moveq	#15-1,d0
			lea		.LSP_InstrumentInfo(pc),a0
			move.l	a1,d1								; sound bank data
.rloop:		add.l	d1,(a0)									; sound bank data
			add.l	d1,6(a0)
			lea		12(a0),a0
			dbf		d0,.rloop
.noReloc:	bset.b	#1,$bfe001	; disable this fucking Low pass filter!!
			lea		.LSPVars+6(pc),a0
			move.w	#125,(a0)		; music BPM
			rts

.dataError:	illegal
; 448 specific callback

; A0=flux des octets / valeurs : volume, note
; A1=

.r_None:
		move.l	a0,(a1)+
		rts

.r_Cp:							; met une note canal C/2
		move.l	a0,(a1)+
		addq.w	#4,a1
		move.l	(a1),a0
		move.w	(a0)+,$26(a6)			; $dff0a0+$26=dff0c6 = AUD2PER = Audio channel 2 period
		move.l	a0,(a1)
		rts

.r_Bp:							; met une note canal B/1
		move.l	a0,(a1)+
		addq.w	#4,a1
		move.l	(a1),a0
		move.w	(a0)+,$16(a6)
		move.l	a0,(a1)
		rts

.r_Ap:							; met une note canal A/0
		move.l	a0,(a1)+
		addq.w	#4,a1
		move.l	(a1),a0
		move.w	(a0)+,$06(a6)
		move.l	a0,(a1)
		rts

