		move.b	(a0)+,$19(a6)			; écrit le volume canal B
		move.l	a0,(a1)+
		rts

.r_Cvp:							; canal C : volume et note
		move.b	(a0)+,$29(a6)			; volume C
		move.l	a0,(a1)+
		addq.w	#4,a1
		move.l	(a1),a0
		move.w	(a0)+,$26(a6)			; note C
		move.l	a0,(a1)
		rts

.r_BpCp:						; note C puis note B
		move.l	a0,(a1)+
		addq.w	#4,a1
		move.l	(a1),a0
		move.w	(a0)+,$26(a6)			; note C
		move.w	(a0)+,$16(a6)			; note B
		move.l	a0,(a1)
		rts

