.r_ArBrCrDr:						; repetition A, repetition B, repetition C, repetition D
		move.l	a0,(a1)+
		lea		.resetv(pc),a3
		move.l	(a3)+,a4			; position pointeur table instruments, sur repetitions
		move.l	(a4)+,$30(a6)			; Audio channel 3 location
		move.w	(a4)+,$34(a6)			; Audio channel 3 length canal D
		move.l	(a3)+,a4
		move.l	(a4)+,$20(a6)
		move.w	(a4)+,$24(a6)
		move.l	(a3)+,a4
