		move.w	d0,$96-$a0(a6)				; DMACon
		move.b	d0,(a0)

		move.l	(a1),a0					; A0=word stream
		lea		.resetv(pc),a3
		movea.l	a1,a2
		add.w	(a0)+,a2				; offset de l'instrument par rapport à lspvars / debut instrument -12
