		add.w	(a0)+,a2					; word stream => vers un instrument
		move.l	(a2)+,$30(a6)					; $A0+$30=$D0 = Audio channel 3 location 
		move.w	(a2)+,$34(a6)					; $A0+$34=$D4 = Audio channel 3 length
		move.l	a2,(a3)+					; sauvegarde pointeur sur l'instrument/sample, en position pointeur debut repetition
		add.w	(a0)+,a2					; instrument suivant, relatif au précédent
		move.l	(a2)+,$20(a6)					; $A0+$20=$C0 = Audio channel 2 location 
