		move.l	a2,(a3)+
		add.w	(a0)+,a2
		move.l	(a2)+,(a6)					; Audio channel 0/A location 
		move.w	(a2)+,$04(a6)
		move.l	a2,(a3)+
		move.l	a0,(a1)
		rts

